INSERT INTO `glosas` (`idglosas`, `codigo`, `descripcion`, `acalracion`) VALUES
(1, '101', 'FACTURACION(CANTIDAD ESTANCIAS)                           ', 'Aplica cuando:1. El cargo por estancia, en cualquier tipo de internación, que viene  relacionado y/o justificado en los soportes de la factura, presenta diferencia con las cantidades que fueron facturadas. 2. El prestador de servicios de salud relaciona excedentes en estancia que la entidad responsable del pago no tiene que asumir de acuerdo con lo pactado por las partes.'),
(2, '102', 'FACTURACION (CANTIDAD CONSULTAS, INTERCONSULTAS VISITA M. ', 'Aplica cuando: 1. El cargo por consulta, interconsulta y/o visita médica que viene relacionado y/o justificado en los soportes de la factura, presenta diferencias con las cantidades que fueron facturadas. 2. En una factura se registra una interconsulta que originó la práctica de una intervención o procedimiento que realizó el mismo prestador. 3. Se cobran consultas o visitas médicas que se encuentran incluidas en los honorarios médicos post-quirúrgicos. 4. Se cobran consultas y/o controles médicos que se encuentran incluidas en los honorarios médicos del procedimiento del parto, según lo pactado entre las partes. 5. El prestador de servicios de salud relaciona excedentes en consultas, interconsultas y visitas médicas que la entidad responsable del pago no tiene que asumir.'),
(3, '103', 'FACTURACION (CANTIDAD,HONORARIOS MEDICOS QX)              ', 'Aplica cuando: 1. Los cargos por honorarios médicos en procedimientos quirúrgicos, de hemodinamia, radiología u otros procedimientos que vienen relacionados y/o justificados en los soportes de la factura, presentan diferencias con las cantidades que fueron facturadas. y/o justificados en los soportes de la factura, presentan diferencias con las cantidades que fueron facturadas. 3. El prestador de servicios de salud relaciona excedentes en honorarios de procedimientos que la entidad responsable del pago no tiene que asumir.'),
(4, '104', 'FACTURACION(CANTIDAD HONORARIOS OTROS PROFESIONALES)      ', 'Aplica cuando: 1. Los cargos por honorarios de los profesionales en salud diferentes a los quirúrgicos y clínicos, que vienen relacionados y/o justificados en los soportes de la factura, presentan diferencias con las cantidades facturadas. 2. El prestador de servicios de salud relaciona excedentes en honorarios de otros profesionales asistenciales que la entidad responsable del pago no tiene que asumir.'),
(5, '105', 'FACTURACION(CANTIDAD DERECHOS DE SALA)                    ', 'Aplica cuando: 1. Los cargos por derechos de sala que vienen relacionados y/o justificados en los soportes de la factura, presentan diferencias con las cantidades que fueron facturadas. 2. El prestador de servicios de salud relaciona excedentes en derechos de sala que la entidad responsable del pago no tiene que asumir. '),
(6, '106', 'FACTURACION CANTIDAD MATERIALES', 'Aplica cuando: 1. Los cargos por materiales que vienen relacionados en el detalle de cargos y/o los soportes, presentan diferencias con las cantidades que fueron facturadas. 2. Se cobran insumos que ya se encuentran incluidos en el ítem de materiales por grupo o atención integral. 3. El prestador de servicios de salud relaciona excedentes en materiales que la entidad responsable del pago no tiene que asumir.'),
(7, '107', 'FACTURACION CANTIDAD MEDICAMENTOS                         ', 'Aplica cuando: 1. Los cargos por medicamentos que vienen relacionados en el  detalle de cargos y/o los soportes, presentan diferencias con las cantidades que fueron facturadas. 2. El prestador de servicios de salud relaciona excedentes en medicamentos que la entidad responsable del pago no tiene que asumir.'),
(8, '108', 'FACTURACION CANTIDAD AYUDAS DIAGNOSTICAS                  ', 'Aplica cuando: 1. Los cargos por ayudas diagnósticas (incluye procedimientos diagnósticos) que vienen relacionados y/o justificados en los soportes de la factura presentan diferencias con las cantidades que fueron facturadas 2. De acuerdo con la tarifa pactada, se facturen separadamente ayudas diagnósticas incluidas una en otra.'),
(9, '109', 'FACTURACION CATIDAD SERVICIOS FUERA DE PAQUETE', 'Aplica cuando: El prestador de servicios de salud registra en la factura cargos detallados que sobrepasan el valor pactado por caso, conjunto integral de atenciones, paquete o grupo relacionado por diagnóstico.'),
(10, '110', 'FACTURACION CANTIDAD INSUMOS INCLUIDOS EN PAQUETE         ', 'Aplica cuando: El prestador de servicios de salud registra en la factura cargos adicionales que se encuentran incluidos en un procedimiento de atención integral de acuerdo con lo pactado'),
(11, '111', 'FACTURACION INSUMOS INCLUIDOS EN ESTANCIA O DERECHOS       ', 'Aplica cuando: 1. Se cobran consultas, interconsultas y/o visitas médicas que están incluidas en las estancias de acuerdo con lo pactado. 2. Se cobran insumos que ya se encuentran incluidos en el ítem de derechos de sala o materiales quirúrgicos. 3. El prestador de servicios de salud registra en la factura actividades, procedimientos o servicios que se encuentran incluidos en la tarifa de la estancia de acuerdo con pactado.'),
(12, '112', 'FACTURACION(FACTURA EXCEDE TOPE AUTORIZADO                ', 'Aplica cuando: La factura presenta excedentes sobre los topes establecidos previamente entre las partes, o excede el saldo disponible del contrato. No aplica en caso de atención inicial de urgencias o cuando se haya emitido autorización.'),
(13, '113', 'FACTURACION FACTURAS POR SEPARADO(RECOBRO CTC O TUTELAS   ', 'Aplica cuando el prestador en una misma factura, registra servicios que previamente se ha pactado que se facturarán en forma independiente, como facturas de recobro por reaseguro, Comité técnico científico o tutelas.'),
(14, '114', 'FACTURACION FACTURA MAL SUMADA EN SUB O TOTALES           ', 'Aplica cuando la sumatoria de los ítems registrados en la factura presenta diferencias con los subtotales o el total de los servicios facturados, incluyendo los detalles de los soportes comparados con los subtotales de la factura.'),
(15, '115', 'FACTURACION FACTURA MAL DILIGENCIADA DATOS USUARIO        ', 'Aplica cuando el prestador del servicio no relaciona en la factura suficiente información del usuario al cual se le prestó el servicio (nombres, apellidos, identificación, plan o programa, entre otros) necesarios para el registro de información por parte de la entidad responsable del pago. Aplica sólo cuando la factura incluye varios pacientes y se puede tramitar parcialmente la factura y se ha acordado contractualmente.'),
(16, '116', 'FACTURACION USUARIO O PLAN CORRESPONDE A OTRO RESPONSABLE     ', 'Aplica cuando la factura incluye varios pacientes y es de trámite parcial 1. En la factura se relacionan usuarios o servicios de los cuales uno o varios corresponden a otra entidad responsable y/o a otro plan de beneficios. NOTA: No se pueden relacionar en una misma factura usuarios de diferentes planes de beneficio (POS y medicina prepagada o planes complementarios) así sea de la misma entidad responsable del pago, los cuales deben ser facturados en forma independiente.'),
(17, '117', 'FACTURACION USUARIO RETIRADO O MOROSO                     ', 'Aplica cuando en la factura se relacionan usuarios que en el momento de la prestación del servicio no está cubierto por la entidad responsable del pago. Aplica sólo cuando la factura incluye varios pacientes y se puede tramitar parcialmente. No aplica cuando la entidad responsable del pago ha emitido la autorización de servicios, o cuando el afiliado acredite el derecho mediante la presentación del comprobante de descuento por parte del empleador.'),
(18, '119', 'FACTURACION ERROR EN DESCUENTO PACTADO                    ', 'Aplica cuando hay descuentos otorgados, que fueron aplicados de manera diferente a lo pactado. Aplica sólo cuando se puede tramitar parcialmente la factura.'),
(19, '120', 'FACTURACION RECIBO DE PAGO COMPARTIDO(COPAGO,OTROS)       ', 'Aplica cuando 1. Los recaudos de bonos, periodos de carencia, o vales que debe efectuar el prestador de servicios, no se realizan o quedan mal liquidados. 2. Los recaudos de cuotas moderadoras, de recuperación o copagos, que efectuó el prestador de servicios, quedan mal liquidados.'),
(20, '122', 'FACTURACION FACTURA PRESENTADA FUERA DE TERMINOS LEGALES  ', 'Aplica cuando El prestador presenta el cobro de un servicio en fecha posterior a la establecida en la normatividad vigente o incumpliendo los términos de los acuerdos contractuales.'),
(21, '123', 'FACTURACION CANTIDADES EN PROCEDIMIENTOS O ACTIDADES     ', 'Aplica cuando: 1. Los cargos por procedimientos o actividades que vienen relacionados y/o justificados en los soportes de la factura presentan diferencias con las cantidades que fueron facturadas. De acuerdo con la tarifa pactada, se facturen separadamente procedimientos o actividades una en otra.'),
(22, '124', 'FACTURACION FALTA FIRMA DEL PRESTADOR DEL SERVICIO       ', 'Aplica cuando 1. La factura no tiene la firma del prestador.'),
(23, '125', 'FACTURACION EXAMEN PERTENECE A PYP                        ', 'Aplica cuando: Se factura una actividad de detección temprana y/o protección específica en una factura de servicios asistenciales y esta actividad hace parte de un paquete de servicios de prevención o protección específica.'),
(24, '126', 'FACTURACION PACIENTE PERTENECE A CAPITACION              ', 'Aplica cuando se factura por evento un servicio prestado a un usuario capitado. Aplica sólo cuando la factura incluye varios pacientes y se puede tramitar parcialmente.'),
(25, '127', 'FACTURACION SERVICIOS O PROCEDIMIENTO INCLUIDOS EN OTROS  ', 'Aplica cuando se cobran servicios o procedimientos que se encuentran incluidos en otro servicio ya cobrado dentro de la misma u otra factura.'),
(26, '128', 'FACTURACION FACTURA YA CANCELADA                          ', 'Aplica cuando el prestador de servicios de salud factura un servicio ya cancelado en la factura o en otra anterior por parte de la entidad responsable del pago. Aplica sólo cuando la factura incluye varios pacientes y se puede tramitar parcialmente'),
(27, '151', 'FACTURACION RECOBRO CAPITACION OTRO PRESTADOR            ', 'Aplica cuando se realizan descuentos al valor a pagar por concepto de capitación, originados en los pagos de servicios incluidos en el contrato de capitación y que por motivo de atención de urgencias, remisión de la IPS contratista o imposibilidad de prestarlo, el servicio es efectivamente prestado por otro prestador.'),
(28, '152', 'FACTURACION DISMINUCION EN EL No. DE PERSONAS CAPITADAS  ', 'Aplica cuando el número de personas incluidas en la capitación es disminuido porque una autoridad competente excluye a algunas de las personas de la base de datos de beneficiarios de subsidios.'),
(29, '201', 'TARIFA DIFERENTE  EN ESTANCIA                             ', 'Aplica cuando el cargo por estancia, que viene relacionado y/o justificado en los soportes de la factura, presenta diferencia con los valores que fueron pactados o establecidos normativamente, vigentes al momento de la prestación del servicio.'),
(30, '202', 'TARIFA DIFERENTE EN CONSULTAS O INTERCONSULTA             ', 'Aplica cuando el cargo por consulta, interconsulta y/o visita médica que viene relacionado y/o justificado en los soportes de la factura, presenta diferencias con los valores que fueron pactados.'),
(31, '203', 'TARIFA DIFERENTE EN HONORARIOS MEDICOS EN PROCEDIMIENTOS ', 'Aplica cuando: 1. Los cargos por honorarios médicos en procedimientos quirúrgicos, de hemodinamia, radiología u otros procedimientos que vienen relacionados y/o justificados en los soportes de la factura, presentan diferencias con las cantidades que fueron relacionados y/o justificados en los soportes de la factura, presentan diferencias con los valores que fueron pactados.  2. Los cargos por honorarios de anestesia que vienen relacionados y/o justificados en los soportes de la factura, presentan diferencias con los valores que fueron pactados, vigentes al momento de la prestación del servicio.'),
(32, '204', 'TARIFA DIFERENTE EN HONORARIOS OTROS PROFESIONALES        ', 'Aplica cuando los cargos por honorarios de los profesionales en salud diferentes a los quirúrgicos y clínicos, que vienen relacionados y/o justificados en soportes de la factura, presentan diferencias con los valores pactados.'),
(33, '205', 'TARIFA DIFERENTE EN DERECHOS DE SALA                      ', 'Aplica cuando los cargos por derechos de sala que vienen relacionados y/o justificados en los soportes de la factura, presentan diferencias con los valores que fueron pactados.'),
(34, '206', 'TARIFA DIFERENTE EN MATERIALES                           ', 'Aplica cuando los cargos por materiales que vienen relacionados y/o justificados en los soportes de la factura, presentan diferencias con los valores pactados.'),
(35, '207', 'TARIFA DIFERENTE EN MEDICAMENTOS                          ', 'Aplica cuando los cargos por medicamentos que vienen relacionados y/o justificados en los soportes de la factura, presentan diferencias con los valores que fueron pactados.'),
(36, '208', 'TARIFA DIFERENTE EN AYUDAS DIAGNOSTICAS                   ', 'Aplica cuando los cargos por ayudas diagnósticas que vienen relacionados y/o justificados en los soportes de la factura presentan diferencias con los valores pactados.'),
(37, '209', 'TARIFA DIFERENTE EN PAQUETE DE ATENCION SEGUN CONTRATO    ', 'Aplica cuando el prestador de servicios de salud registra en la factura un mayor valor en el cobro del caso, conjunto integral de atenciones, paquete o grupo relacionado por diagnóstico, o presenta cargos detallados cuya sumatoria final resulta superior a la tarifa pactada. No aplica cuando se haya pactado, o en la normatividad vigente se encuentre establecido el cobro adicional de servicios que exceden el paquete.'),
(38, '223', 'TARIFA DIFERENTE EN PROCEDIMIENTO O ACTIVIDAD            ', 'Aplica cuando los cargos por procedimientos o actividades que vienen relacionados y/o justificados en los soportes de la factura presentan diferencias con los valores pactados.'),
(39, '229', 'TARIFA DIFERENTE EN REGARGOS PACTADOS A LA FACTURA       ', 'Aplica cuando en la factura se adicionan cobros de recargos no pactados previamente entre la entidad responsable del pago y el prestador de servicios de salud.'),
(40, '301', 'SOPORTES, FALTA  DE SOPORTE DE ESTANCIA                   ', 'Aplica cuando existe ausencia total o parcial, inconsistencia, enmendaduras o ilegibilidad en los soportes de la factura que evidencian la estancia.'),
(41, '302', 'SOPORTES,FALTA DE SOPORTE  DE CONSULTAS ,ITNERCONSULTAS Y VISITAS MEDICAS                  ', 'Aplica cuando existe ausencia total o parcial, inconsistencia, enmendaduras o ilegibilidad en los soportes de la factura que evidencian la estancia. evidencian la consulta, interconsulta y/o visita médica.'),
(42, '303', 'SOPORTES, FALTA  DE SOPORTE HONORARIO MEDICO              ', 'Aplica cuando: 1. Existe ausencia total o parcial, inconsistencia, enmendaduras o ilegibilidad en los soportes de la factura que evidencian los honorarios médicos en procedimientos quirúrgicos, de hemodinamia, radiología u otros procedimientos que vienen relacionados y/o justificados en los soportes de la factura. 2. Existe ausencia total o parcial, inconsistencia, enmendaduras o ilegibilidad en los soportes de la factura que evidencian los honorarios de anestesia que vienen relacionados y/o justificados en la factura.'),
(43, '304', 'SOPORTES, FALTA  DE SOPORTE HONORARIO OTROS PROFESIONALES ', 'Existe ausencia total o parcial, inconsistencia, enmendaduras o ilegibilidad en los soportes de la factura que evidencian los honorarios de los profesionales en salud, diferente a los quirúrgicos y clínicos, que vienen relacionados y/o justificados en la factura.'),
(44, '307', 'SOPORTES, FALTA DE SOPORTE DE MEDICAMENTOS                ', 'Existe ausencia total o parcial, enmendaduras o ilegibilidad en la hoja de administración de medicamentos o en el comprobante de recibido de medicamentos por parte de los usuarios. Existe inconsistencia en los contenidos de la factura o documente equivalente frente a relacionados en la hoja de administración de medicamentos o en el comprobante de recibido de medicamentos por parte de los usuarios'),
(45, '308', 'SOPORTES, FALTA DE SOPORTE DE AYUDAS DIAGNOSTICAS         ', 'Existe ausencia total o parcial, inconsistencia, enmendaduras o ilegibilidad en los soportes de la factura que evidencian la práctica de ayudas diagnósticas que vienen relacionadas y/o justificadas en los soportes de la factura. Incluye la ausencia de lectura del profesional correspondiente, cuando aplica.'),
(46, '309', 'SOPORTES, FALTA SOPORTES DE PAQUETE DE ATENCION TOTAL     ', 'Existe ausencia total o parcial, inconsistencia, enmendaduras o ilegibilidad en los soportes de la factura que evidencian las actividades adicionales al caso, conjunto integral de atenciones, paquete o grupo relacionado por diagnóstico.'),
(47, '320', 'SOPORTES, RECIBO DE PAGO COMPARTIDO', 'Aplica cuando se le esté cobrando el 100% de la factura. Aplica cuando no se anexan a la factura los soportes de los bonos, vouchers o vales por periodos de carencia, cuotas moderadoras, de recuperación, copagos, que recibió el prestador de servicios de salud.'),
(48, '330', 'SOPORTES, FALTA SOPORTE AUTORIZACION SERV ADICIONALES    ', 'Aplica cuando se evidencia que los vouchers o los bonos presentan enmendaduras, tachones o no se encuentran debidamente firmados por el paciente o un acudiente en el caso de imposibilidad para firmar. Solo aplica en caso de cobro del 100% de la factura a la entidad responsable del pago.'),
(49, '331', 'SOPORTES, BONOS O VOUCHERS SIN FIRMA PACIENTE, EMENDADURA ', 'Aplica cuando se evidencia que los vouchers o los bonos presentan enmendaduras, tachones o no se encuentran debidamente firmados por el paciente o un acudiente en el caso de imposibilidad para firmar. Solo aplica en caso de cobro del 100% de la factura a la entidad responsable del pago.'),
(50, '332', 'SOPORTES, FALTA O ENMENDADURA SOPORTE DETALLE DE CARGOS   ', 'Aplica cuando: 1. Existe ausencia total o parcial, inconsistencia, enmendaduras o ilegibilidad en los soportes de la factura que evidencian los honorarios médicos en procedimientos quirúrgicos, de hemodinamia, radiología u otros procedimientos que vienen  de cargos, de los valores facturados. 2. Se anexan detalle de cargos de usuarios diferentes al registrado en la factura.'),
(51, '333', 'SOPORTES, HISTORIA CLINICA INCOMPLETA                     ', 'Aplica cuando existe ausencia total o parcial, inconsistencia, enmendaduras o ilegibilidad en la copia de la historia clínica completa para el recobro. Aplica sólo en los eventos de alto costo.'),
(52, '335', 'SOPORTES, FALTA DE FORMATO ATEP                           ', 'Aplica cuando existe ausencia total o parcial, inconsistencia, enmendaduras o ilegibilidad en el formulario del IPAT (Informe del Presunto Accidente de Trabajo), en los casos que los eventos correspondan a un accidente de trabajo o enfermedad profesional ATEP. En caso de no contarse con el IPAT, este soporte se sustituye por el informe que haga el prestador de servicios de salud al asegurador del presunto origen laboral para que el asegurador solicite el formulario. Decreto 2463/2001 Art. 25'),
(53, '336', 'SOPORTES, FALTA DE SOPORTE DE FACTURA EXEDENTE SOAT       ', 'Aplica cuando existe ausencia total o parcial, inconsistencia, enmendaduras o ilegibilidad en las copias de las facturas enviadas a la compañía de seguros SOAT, al encargo fiduciario de FOSYGA con sus respectivos detalles, cumpliendo los topes.'),
(54, '337', 'SOPORTES, FALTA DE SOPORTE DE FORMULA MEDICA, ENMENDADA   ', 'Aplica cuando existe ausencia total o parcial, inconsistencia, enmendaduras o ilegibilidad en la orden y/o fórmula médica.'),
(55, '338', 'SOPORTES, FALTA SOPORTE  TRASLADO EN AMBULANCIA           ', 'Aplica cuando existe ausencia total o parcial, inconsistencia, enmendaduras o ilegibilidad en la hoja de traslado.'),
(56, '339', 'SOPORTES, FALTA SOPORTE RECIBO DE USUARIO                 ', 'Aplica cuando existe ausencia total o parcial, inconsistencia, enmendaduras o ilegibilidad en el comprobante de recibido del usuario como evidencia de haber recibido el servicio.'),
(57, '340', 'SOPORTES, FALTA SOPORTE  REGISTRO DE ANESTESIA,           ', 'Aplica cuando existe ausencia total o parcial, inconsistencia, enmendaduras o ilegibilidad en el registro de anestesia.'),
(58, '341', 'SOPORTES, FALTA SOPORTE DE DESCRIPCION QUIRURGICA         ', 'Aplica cuando existe ausencia total o parcial, inconsistencia, enmendaduras o ilegibilidad de la copia de la descripción operatoria de cirugía.'),
(59, '342', 'SOPORTES FALTA SOPORTE LISTA  DE  PRECIOS DE COMPRA       ', 'Aplica únicamente cuando no existe contrato entre el prestador y el pagador y el prestador debe adjuntar la parte del documento que relaciona los precios de compra del prestador para los medicamentos e insumos incluidos en la factura. No aplica en los casos en que existe contrato entre el pagador y el prestador ya que esta lista de precios debe ser un anexo del contrato, a menos que se requiera actualizar la información'),
(60, '401', 'AUTORIZACIONES, FALTA AUTORIZACION DE ESTANCIA            ', 'Aplica cuando: 1. El número de horas en observación, o días en habitación, que vienen relacionados en la factura presenta diferencia con los días autorizados. 2. El tipo de estancia prestado no corresponde al autorizado.'),
(61, '402', 'AUTORIZACIONES, FALTA AUTORIZACION CONSULTAS O INTERCONSU ', 'Aplica cuando la consulta, interconsulta y/o visita médica relacionada y/o justificada en los soportes de la factura presenta diferencias con lo autorizado.'),
(62, '406', 'AUTORIZACIONES FALTA AUTORIZACION EN MATERIALES           ', 'Aplica cuando los materiales que vienen relacionados y/o justificados en los soportes de la factura, presentan diferencias con los autorizados.'),
(63, '408', 'AUTORIZACIONES FALTA AUTORIZACION EN AYUDAS DIAGNOSTICAS  ', 'Aplica cuando las ayudas diagnósticas relacionadas y/o justificados en los soportes de la factura presentan diferencias con lo autorizado.'),
(64, '423', 'AUTORIZACIONES, FALTA AUTORIZACION PROCEDIMIENTO O ACT    ', 'Aplica cuando el procedimiento o actividad prestada relacionada y/o justificada en los soportes de la factura, difiere de la autorizada.'),
(65, '430', 'AUTORIZACIONES, FALTA AUTORIZACION DE SERVICIOS ADICIONAL ', 'Existe ausencia total o parcial, inconsistencia, enmendaduras o ilegibilidad en los soportes de la factura que evidencian la autorización de algunos servicios no incluidos en el evento principal del plan de manejo o de la solicitud formulada oportunamente por el prestador y no respondida en los términos de la presente resolución.'),
(66, '443', 'AUTORIZACIONES, AUTORIZACION O ORDEN VENCIDAS             ', 'Aplica cuando: 1. La orden o autorización de servicios que se anexa como soporte de la factura ha superado el límite de días de vigencia. 2. La orden o autorización de servicios que se anexa como soporte de la factura ha sido reemplazada por solicitud del prestador de servicios de salud.'),
(67, '444', 'AUTORIZACION PROFESIONAL QUE ORDENA NO ADSCRITO           ', 'Aplica en aquellos casos que se presten servicios ordenados por un profesional que no hace parte del cuerpo médico de la entidad responsable del pago.'),
(68, '501', 'COBERTURA, NO COBERTURA DE ESTANCIA                       ', 'Aplica cuando el número de días en observación o habitación, que vienen relacionados en la factura no están incluidos en el respectivo plan ó hacen parte integral de un servicio y se están cobrando adicionalmente.'),
(69, '502', 'COBERTURA, NO COBERTURA DE CONSULTAS O INTERCONSULTA S    ', 'Aplica cuando la consulta, interconsulta y/o visita médica relacionadas no están incluidas en el respectivo plan ó hacen parte integral de un servicio y se están cobrando adicionalmente.'),
(70, '506', 'COBERTURA, NO COBERTURA DE MATERIALES                     ', 'Aplica cuando los materiales que vienen relacionados y/o justificados en los soportes de la factura, presentan diferencias con los autorizados. hacen parte integral de un servicio y se están cobrando adicionalmente.'),
(71, '507', 'COBERTURA, NO COBERTURA DE MEDICAMENTOS                   ', 'Aplica cuando los medicamentos entregados o relacionados en la hoja de suministro de medicamentos y/o justificados en la factura no están incluidos en el respectivo plan ó hacen parte integral de un servicio y se están cobrando adicionalmente.'),
(72, '508', 'COBERTURA, NO COBERTURA DE AYUDAS DIAGNOSTICAS            ', 'Aplica cuando las ayudas diagnósticas relacionadas y/o justificados en los soportes de la factura presentan diferencias con lo autorizado. hacen parte integral de un servicio y se están cobrando adicionalmente.'),
(73, '523', 'COBERTUR,A NO COBERTURA DE PROCEDIMIENTO O ACTIVIDAD      ', 'Aplica cuando en la factura se cobra un procedimiento o una actividad que no están incluidos en el respectivo plan ó hacen parte integral de un servicio y se están cobrando adicionalmente.'),
(74, '527', 'COBERTURA, SERVICIO O PROCEDIMIENTO INCLUIDO EN OTRO      ', 'Aplica cuando se factura por separado un procedimiento incluido en otro ya facturado.'),
(75, '545', 'COBERTURA, SERVICIO NO PACTADO                            ', 'Aplica cuando en la factura se cobra un servicio que no se encuentra establecido entre las partes.'),
(76, '546', 'COBERTURA, COBERTURA SIN AGOTAR POLIZA (SOAT)             ', 'Aplica cuando se facturan servicios a la entidad responsable del pago sin agotar los topes cubiertos por las pólizas de Seguro Obligatorio de accidentes de tránsito y el administrador fiduciario de FOSYGA.'),
(77, '601', 'PERTINENCIA, ESTANCIA NO PERTINENTE                       ', 'Aplica cuando el cargo por estancia, sea ésta en observación o, habitación, que viene relacionado en los soportes de la factura, no es pertinente o no tiene justificación médica para el cobro.'),
(78, '602', 'PERTINENCIA, NO PERTINENTE CONSULTAS O INTERCONSULTAS     ', 'Aplica cuando el cargo por consulta, interconsulta y/o visita médica que viene relacionado y/o justificado en los soportes de la factura, presenta diferencias con los valores que fueron pactados. no tiene justificación médica para el cobro.'),
(79, '603', 'PERTINENCIA, NO PERTINENTE HONORARIOS MEDICOS             ', 'Aplica cuando: 1. Los cargos por honorarios médicos en procedimientos quirúrgicos, de hemodinamia, radiología u otros procedimientos que vienen relacionados en los soportes de la factura no son pertinentes o no tienen justificación médica para el cobro. 2. Los cargos por honorarios de anestesia que vienen relacionados en los soportes de la factura no son pertinentes o no tienen justificación médica para el cobro.'),
(80, '604', 'PERTINENCIA, NO PERTINENTE HONORARIOS  OTROS PROFESIONALE ', 'Aplica cuando los cargos por honorarios de otros profesionales asistenciales diferentes a los quirúrgicos y clínicos, que vienen relacionados en los soportes de la factura no son pertinentes o no tienen justificación para el cobro.'),
(81, '605', 'PERTINENCIA, NO PERTINENTE DERECHOS DE SALA               ', 'Aplica cuando los cargos por derechos de sala que vienen relacionados en los soportes de la factura no son pertinentes o no tienen justificación médica para el cobro.'),
(82, '606', 'PERTINENCIA, NO PERTINENTE MATERIALES                     ', 'Aplica cuando los cargos por materiales que vienen relacionados en el detalle de cargos y/o los soportes pactados no son pertinentes o no  tienen justificación médica para el cobro.'),
(83, '607', 'PERTINENCIA, NO PERTINENTE MEDICAMENTOS JUSTIFICACION     ', 'Aplica cuando los cargos por medicamentos que vienen relacionados en el detalle de cargos y/o los soportes pactados no son pertinentes o no tienen justificación médica para el cobro.'),
(84, '608', 'PERTINENCIA, NO PERTINENTE AYUDAS DIAGNOSTICAS            ', 'Aplica cuando los cargos por ayudas diagnósticas que vienen relacionados en los soportes de la factura no son pertinentes o no tienen justificación médica para el cobro.'),
(85, '623', 'PERTINENCIA, NO PERTINENTE PROCEDIMIENTOS O ACTIVIDAD     ', 'Aplica cuando los cargos por procedimientos o actividades que vienen relacionados en los soportes de la factura no son pertinentes o no tienen justificación médica para el cobro.'),
(86, '653', 'PERTINENCIA, URGENCIA NO PERTINENTE                       ', 'Aplica cuando los servicios prestados no obedecen a una atención de urgencia de acuerdo con la definición de la normatividad vigente.'),
(87, '816', 'DEVOLUCIONES,USUARIO PERTENECE A OTRO PLAN O RESPONSABLE  ', 'Aplica cuando: 1. La factura corresponde a un usuario que pertenece a otra entidad responsable del pago 2. La factura corresponde a un usuario o servicio que pertenece a otro plan de la misma entidad responsable del pago 3. La factura corresponde a un servicio que debe ser pagado por otra entidad responsable del pago Nota: Aplica sólo cuando la factura que incluye varios usuarios, no se puede tramitar parcialmente.'),
(88, '817', 'DEVOLUCIONES,USUARIO RETIRADO O MOROSO                    ', 'Aplica cuando la factura corresponde a un usuario que en el momento de la prestación del servicio no está cubierto por la entidad responsable del pago o se encuentra moroso en el pago. Nota: Aplica sólo cuando la factura que incluye varios usuarios, no se puede tramitar parcialmente.'),
(89, '821', 'DEVOLUCIONES,FALTA AUTORIZACION TOTAL                     ', 'Aplica cuando se carece de autorización principal o ésta no corresponde al prestador de servicios. Cuando la entidad responsable del pago no se haya pronunciado dentro de los términos definidos en la normatividad vigente, será suficiente soporte la copia de la solicitud enviada a la entidad responsable del pago, o a la dirección departamental o distrital de salud y en tal caso no aplicará esta causa de devolución. '),
(90, '834', 'DEVOLUCIONES,FALTA EPICRISIS,HISTORIA CLINICA, HOJA URG   ', 'Aplica cuando:1. No se anexa a la factura de internación o de urgencias con observación la epicrisis. 2. Para el caso de facturas de atención de urgencias, cuando no se anexa la hoja de atención de urgencias 3. Para el caso de facturas de atención odontológica, cuando no se anexa el odontograma. puede tramitar parcialmente. Nota: Aplica sólo cuando la factura que incluye varios usuarios, no se\npuede tramitar parcialmente.'),
(91, '844', 'DEVOLUCIONES,PROFESIONAL QUE ORDENA NO ADSCRITO           ', 'Aplica cuando el profesional que ordena el servicio no hace parte del cuerpo médico de la entidad responsable de pago. No aplica en caso de atención inicial de urgencias.'),
(92, '847', 'DEVOLUCIONES,FALTA SOPORTE DE JUSTIFICACION CTC, TUTELAS) ', 'Aplica cuando no se incluyen en la factura los soportes de justificación para recobros de comité técnico científico, tutelas o accidentes de trabajo o enfermedad profesional de conformidad con la normatividad vigente.'),
(93, '848', 'DEVOLUCIONES,INFORME ATENCION INICIAL DE URGENCIAS        ', 'Aplica cuando la atención de urgencias no es informada a la entidad responsable del pago, en los términos definidos. No aplica en los casos que no sea posible identificar la entidad responsable de pago dentro de los términos establecidos, ni en aquellos casos en los que se formuló solicitud de autorización para prestación de servicios adicionales dentro de las 24 horas siguientes al inicio de la atención inicial de urgencias. Se consideran informadas aquellas atenciones comunicadas a las direcciones departamentales y distritales de salud por no haberse establecido comunicación con la entidad responsable del pago, en los términos establecidos en la presente resolución.'),
(94, '849', 'DEVOLUCIONES,FACTURA NO CUMPLE CON REQUISITOS LEGALES     ', 'Aplica cuando la factura o el documento equivalente a la factura no cumplen con alguno de los requisitos legales.'),
(95, '850', 'DEVOLUCIONES,FACTURA YA CANCELADA                         ', 'Aplica cuando la factura corresponda a servicios ya cancelados por la entidad responsable del pago'),
(96, '996', 'RESPUESTAS,GLOSAS DEVOLUCION INJUSTIFICADA                ', 'Aplica cuando el prestador de servicios de salud informa a la entidad responsable del pago que la glosa o devolución es injustificada al 100%.'),
(97, '997', 'RESPUESTAS DE GLOSAS ACEPTADA EN SU TOTALIDAD            ', 'Aplica cuando el prestador de servicios de salud informa a la entidad responsable del pago que la glosa o devolución ha sido aceptada al 100%.'),
(98, '998', 'RESPUESTAS, DE GLOSAS ACEPTADA PARCIALMENTE               ', 'Aplica cuando el prestador de servicios de salud informa a la entidad responsable del pago que la glosa o devolución ha sido aceptada parcialmente.'),
(99, '999', 'RESPUESTAS, DE GLOSAS O DEVOLUCION NO ACEPTADA            ', 'Aplica cuando el prestador de servicios de salud informa a la entidad responsable del pago que la glosa o devolución siendo justificada ha podido ser subsanada totalmente.');
